import React, { useState } from 'react';
import Navbar from './navbar';
import Option from './Options';

const Body = () => {
	const [count, setCount] = useState(0);
	const add = () => {
		console.log(count)
      return setCount(count + 1);
		}
		return(
			<div>
				<Navbar/>
				<Option count={add}/>
			</div>
		);
}

export default Body;
